import React from "react";
import {RouteComponentProps} from "react-router";
import {App, Server} from "../types/types";
import serve from "@webpack-cli/serve";

interface Props {
    email: string | null;
    servers: Server[];
    editServer: (server: Server, email: string | null) => void;
    removeServer: (id: number, email: string | null) => void;
    sshConnectionUpdate: (ip: string, user: string, password: string, type: string) => void;
}

interface State {
    user: null | string,
    password: null | string,
    sshIp: null | string,
    name: string;
    ip: string;
    id: number;
}

interface Action {
    type: string;
    payload: any;
}

const {useReducer} = React;

function reducer(state: State, action: Action) {
    switch (action.type) {
        case 'user': {
            return {
                ...state, user: action.payload
            }
        }
        case 'password': {
            return {
                ...state, password: action.payload
            }
        }
        case 'sshIp': {
            return {
                ...state, sshIp: action.payload
            }
        }
        case 'name': {
            return {
                ...state, name: action.payload
            }
        }
        case 'id': {
            return {
                ...state, id: action.payload
            }
        }
        case 'ip': {
            return {
                ...state, ip: action.payload
            }
        }
        default: {
            return {
                ...state, user: null, password: null, sshIp: null, ip: 'default', id: 0, name: 'default'
            }
        }
    }
}

export const ServerList: React.FC<Props> = props => {

    const initState: State = {
        user: null,
        password: null,
        sshIp: null,
        name: 'default',
        ip: 'default',
        id: 0
    };
    const [state, dispatch] = useReducer(reducer, initState);
    const {servers, editServer, removeServer, email, sshConnectionUpdate} = props;

    const changer = (e: React.SyntheticEvent<HTMLInputElement>, type: string) => {
        dispatch({type: type, payload: e.currentTarget.value});
    };

    const deleter = (id: number) => {
        removeServer(id, email)
    };

    const edit = () => {
        let server = (props.servers.filter((server) => {
            return server.id === state.id;
        }))[0];
        server = {
            name: state.name !== 'default' ? state.name : server.name,
            id: state.id,
            ip: state.ip !== 'default' ? state.ip : server.ip,
            status: server.status,
            connectedBySSH: server.connectedBySSH
        };
        editServer(server, email);
        let elem = document.getElementById('server-editor');
        if (elem !== null) {
            elem.style.display = 'none';
        }
    };

    const funct = (id: number) => {
        const elem = document.getElementById('server-editor');
        if (elem !== null) {
            elem.style.display = 'block';
            dispatch({type: 'id', payload: id});
        }
    };

    // const connectOrDeleteSSH = (type: string) => {
    //     if (type === 'connect') {
    //         let elem = document.getElementById('ssh-connector');
    //         if (elem !== null) {
    //             elem.style.display = 'none';
    //         }
    //         sshConnectionUpdate(state.sshIp, state.user, state.password, type);
    //     } else if (type === 'deleteCon') {
    //         sshConnectionUpdate(state.sshIp, state.user, state.password, type);
    //     }
    // };

    //SHH_CONNECTION     ???????????
    const list = servers.map((server: Server, key: number) => {
            <tr id={'server' + key}>
                <td>{server.name}</td>
                <td>{server.ip}</td>
                <td>{server.status}</td>
                <td>{server.connectedBySSH}</td>
                <td>
                    <button onClick={() => funct(server.id)}>Edit server
                    </button>
                </td>
                {/*{server.connectedBySSH === true ?*/}
                    {/*<td>*/}
                        {/*<button onClick={() => {*/}
                            {/*dispatch({type: 'sshIp', payload: server.ip});*/}
                            {/*let elem = document.getElementById('ssh-connector');*/}
                            {/*if (elem !== null) {*/}
                                {/*elem.style.display = 'block';*/}
                            {/*}*/}
                        {/*}}>Create SSH-connection*/}
                        {/*</button>*/}
                    {/*</td>*/}
                    {/*:*/}
                    {/*<td>*/}
                        {/*<button onClick={() => {*/}
                            {/*dispatch({type: 'sshIp', payload: server.ip});*/}
                            {/*connectOrDeleteSSH('deleteCon');*/}
                        {/*}}>Remove SSH-connection*/}
                        {/*</button>*/}
                    {/*</td>}*/}
                <td>
                    <button onClick={() => deleter(server.id)}>Delete server</button>
                </td>
            </tr>
        }
    );

    return (
        <div className={'server-list'}>
            <table>
                <thead>
                <tr>
                    <td>Server name</td>
                    <td>Ip address</td>
                    <td>Server status</td>
                    <td>Connected by SSH</td>
                </tr>
                </thead>
                <tbody>
                {list}
                </tbody>
            </table>
            <div className={'editor-connector'} id={'server-editor'} style={{display: 'none'}}>
                <span className={'closer'}/>
                <label className={'log-label'}>Name</label>
                <input onChange={(e) => changer(e, 'name')} type={'text'} className={'text-input'}/>
                <label className={'log-label'}>Ip</label>
                <input onChange={(e) => changer(e, 'ip')} type={'text'} className={'text-input'}/>
                <button onClick={() => edit()}>Edit</button>
            </div>
            {/*<div className={'editor-connector'} id={'ssh-connector'} style={{display: 'none'}}>*/}
                {/*<span className={'closer'}/>*/}
                {/*/!*<label className={'log-label'}>Server ip</label>*!/*/}
                {/*/!*<input onChange={(e) => changer(e, 'sshIp')} type={'text'} className={'text-input'}/>*!/*/}
                {/*<label className={'log-label'}>Input username</label>*/}
                {/*<input onChange={(e) => changer(e, 'user')} type={'text'} className={'text-input'}/>*/}
                {/*<label className={'log-label'}>Input password</label>*/}
                {/*<input onChange={(e) => changer(e, 'password')} type={'password'} className={'text-input'}/>*/}
                {/*<button onClick={() => connectOrDeleteSSH('connect')}>Connect</button>*/}
            {/*</div>*/}
        </div>
    );
};
